import React, { useEffect, useState } from "react";
import "../../css/EditCompany.css";
import register from "../../images/register.png";
import {
  Col,
  Container,
  Form,
  FormGroup,
  Label,
  Row,
} from "reactstrap";

import TextField from "@material-ui/core/TextField";

import SidebarAdmin from "../Sidebar/SidebarAdmin";
import { useLocation } from "react-router-dom";
import userListAPI from "../../api/userListAPI";

function CompanyRegister() {
  const data = useLocation();
  const [editCompanyRegister, setEditCompanyRegister] = useState({
    company_name: "",
    street_address: "",
    phone_number: "",
    applicant: "",
    applicant_email: "",
    status: 1,
  });

  function handleChange(event) {
    const target = event.target;
    const name = target.name;
    const value = target.value;
    setEditCompanyRegister({
      ...editCompanyRegister,
      [name]: value,
    });
  }

  function handleSubmit(event) {
    event.preventDefault();
    console.log(editCompanyRegister);
  }
  useEffect(() => {
    async function GetAdmin() {
      const id = data.state.adminId;
      try {
        const response = await userListAPI.getUserById(id);
        setAdmin({
          name: response.data.name,
          email: response.data.email,
        });
      } catch (error) {
        console.log(error);
      }
    }
    GetAdmin();
  }, [data.state.adminId]);
  return (
    <div>
      <SidebarAdmin />
      <div className="main-panel">
        <Container fluid={true}>
          <div>
            <img style={{ marginTop: "20px" }} src={register} alt="" />
          </div>
          <Form
            style={{
              width: "60%",
              marginLeft: "auto",
              marginRight: "auto",
              marginTop: 50,
              textAlign: "left",
            }}
          >
            <Row>
              <Col sm={3}>
                <Label style={{ fontSize: 20, color: "blue" }}>
                  Company Name
                </Label>
              </Col>
              <Col>
                <TextField
                  fullWidth
                  variant="outlined"
                  type="text"
                  name="company_name"
                  required
                  size="small"
                  onChange={handleChange}
                />
              </Col>
            </Row>
            <Row style={{ marginTop: 20 }}>
              <Col sm={3}>
                <Label style={{ fontSize: 20, color: "blue" }}>
                  Manager Name
                </Label>
              </Col>
              <Col>
                <TextField
                  fullWidth
                  variant="outlined"
                  type="text"
                  name="manager_name"
                  required
                  size="small"
                  onChange={handleChange}
                />
              </Col>
            </Row>
            <Row style={{ marginTop: 20 }}>
              <Col sm={3}>
                <Label style={{ fontSize: 20, color: "blue" }}>
                  Phone Number
                </Label>
              </Col>
              <Col>
                <TextField
                  fullWidth
                  variant="outlined"
                  type="phone"
                  name="phone"
                  required
                  size="small"
                  onChange={handleChange}
                />
              </Col>
            </Row>
            <Row style={{ marginTop: 20 }}>
              <Col sm={3}>
                <Label style={{ fontSize: 20, color: "blue" }}>
                  Manager Email
                </Label>
              </Col>
              <Col>
                <TextField
                  fullWidth
                  variant="outlined"
                  type="email"
                  name="manager_email"
                  required
                  size="small"
                  onChange={handleChange}
                />
              </Col>
            </Row>
            <Row style={{ marginTop: 20 }}>
              <Col sm={3}>
                <Label style={{ fontSize: 20, color: "blue" }}>
                  Street Address
                </Label>
              </Col>
              <Col>
                <TextField
                  fullWidth
                  variant="outlined"
                  type="text"
                  name="address"
                  required
                  size="small"
                  onChange={handleChange}
                />
              </Col>
            </Row>
          </Form>
        </Container>
      </div>
    </div>
  );
}

export default CompanyRegister;
